import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Header() {
  const [open, setOpen] = useState(false);
  const navigate = useNavigate();

  const user = JSON.parse(localStorage.getItem("user"));

  const logoutHandler = () => {
    localStorage.removeItem("user");
    setOpen(false);
    navigate("/home");
  };

  return (
    <header className="header">
      {/* LOGO */}
      <h2
        onClick={() => navigate("/home")}
        style={{
          cursor: "pointer",
          fontFamily: "Poppins, sans-serif",
          fontWeight: "800",
          fontStyle: "italic",
          letterSpacing: "0.5px",
          color: "#fff"
        }}
      >
        Storefront
      </h2>

      {/* SEARCH */}
      <div className="search-box">
  <input type="text" placeholder="Search products..." />

  {/* SEARCH ICON (SVG) */}
  <svg
    className="search-icon"
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 24 24"
    fill="none"
    stroke="currentColor"
    strokeWidth="2"
    strokeLinecap="round"
    strokeLinejoin="round"
  >
    <circle cx="11" cy="11" r="8"></circle>
    <line x1="21" y1="21" x2="16.65" y2="16.65"></line>
  </svg>
</div>


      {/* NAV */}
      <nav style={{ position: "relative", display: "flex", alignItems: "center" }}>

        {/* USER ICON */}
        <span
          className="user-icon"
          onClick={() => setOpen(!open)}
        >
          <i className="fa-solid fa-user"></i>
        </span>

        {/* DROPDOWN */}
        {open && (
          <div className="dropdown">
            {!user ? (
              <div
                className="dropdown-item"
                onClick={() => {
                  setOpen(false);
                  navigate("/login");
                }}
              >
                <i className="fa-solid fa-right-to-bracket"></i> Login
              </div>
            ) : (
              <>
                <div className="dropdown-item">
                  <i className="fa-regular fa-user"></i> My Profile
                </div>

                <div className="dropdown-item">
                  <i className="fa-solid fa-star"></i> Plus Zone
                </div>

                <div
                  className="dropdown-item"
                  onClick={() => {
                    setOpen(false);
                    navigate("/orders");
                  }}
                >
                  <i className="fa-solid fa-box"></i> Orders
                </div>

                <div className="dropdown-item">
                  <i className="fa-regular fa-heart"></i> Wishlist
                </div>

                <div className="dropdown-item">
                  <i className="fa-solid fa-gift"></i> Rewards
                </div>

                <div className="dropdown-item">
                  <i className="fa-solid fa-credit-card"></i> Gift Cards
                </div>

                <div className="dropdown-divider"></div>

                <div
                  className="dropdown-item logout"
                  onClick={logoutHandler}
                >
                  <i className="fa-solid fa-right-from-bracket"></i> Logout
                </div>
              </>
            )}
          </div>
        )}


        <Link to="/orders">Orders</Link>
        <Link to="/cart">Cart</Link>

      </nav>
    </header>
  );
}
